import React, { Component } from 'react';

const instrument = [
    {
        name: 'mando',
        price: '150'
    },
    {
        name: 'violen',
        price: '155'
    }
];

localStorage.setItem('list', JSON.stringify(instrument))

class App extends Component{
    componentWillMount(){
       const instrments =  localStorage.getItem('instrument')
       console.log(instrments);

    }

   render(){
       return (
           <div className="App">
               <h1>Instrument List</h1>
           </div>
       )
   }
}

export default App;
